import React from 'react';
import { Link } from 'react-router-dom';
import './style.scss'
import PwButton from "../../Components/button";

function HomePage() {
    return (
        <div>
            <h1>Etudier avec les meilleurs musiciens du monde</h1>
            <p>Vivez des masterclasses vidéo immersives où que vous soyez. De nouvelles masterclasses ajoutéees chaque mois.</p>

            <div className="btn-container">
                <PwButton variant={"primary"} size={"large"} title={"Connectez-vous"} link={'/login'}></PwButton>
                <PwButton variant={"border"} size={"large"} title={"Essaie Version Gratuite"}></PwButton>
            </div>
            <div>
                <Link to="/login">Aller à la page de connexion</Link>
            </div>
        </div>
    );
}

export default HomePage;
